function DayBtn(props) {
  return (
    <div className="DayBtn">
      {props.duration === 1 ? (
        <button id="one">Day 1</button>
      ) : props.duration === 2 ? (
        <>
          <button id="two" >Day 1</button>
          <button id="two">Day 2</button>
        </>
      ) : (
        <>
          <button id="three">Day 1</button>
          <button id="three">Day 2</button>
          <button id="three">Day 3</button>
        </>
      )}
    </div>
  );
}

export default DayBtn;
